import React, { useEffect } from 'react';

function Summary() {
  useEffect(() => {
    const dadosString = sessionStorage.getItem('dados');
    const dados = JSON.parse(dadosString);

    // Verificando se os dados são válidos antes de exibir
    if (dados) {
      const botoxPrice = dados.botoxQuant * 1300; // Supondo que os dados possuam uma propriedade "botoxQuant"
      const botoxFullfacePrice = dados.outroElementoQuant * 1000; // Supondo que os dados possuam uma propriedade "outroElementoQuant"

      document.getElementById('list').innerHTML = `
        <li>Botox: ${dados.botoxQuant} - ${botoxPrice}</li>
        <li>Botox Full Face: ${dados.outroElementoQuant} - ${botoxFullfacePrice}</li>
        <!-- Adicione mais elementos aqui, conforme necessário -->
      `;
    }
  }, []);

  return (
    <div>
      <div className="flex justify-center">
        <form className="pt-12" method="form" action="/summary">
          <div className="flex justify-center text-4xl text-white mb-10">Resumo</div>
          <ul id="list">
            {/* A lista de itens é criada dinamicamente no useEffect */}
          </ul>
          <div className="flex justify-end text-white pt-4">
            <input type="submit" value="Submit" className="border rounded-md p-1" />
          </div>
        </form>
      </div>
    </div>
  );
}

export default Summary;
